export default function CatalogueScreen() {
  return (
    <div style={{ marginTop: "20vh", overflowX: "hidden" }}>
      <Row>
        <Col md={4} className="bg-primary text-light">
          <div >
            <span>Categoria 1</span>
          </div>
        </Col>
        <Col md={8}></Col>
      </Row>
    </div>
  );
}
